import axios from "axios";

const API_BASE = "http://localhost:5001"; // your backend URL

export const getLatestReading = async () => {
  try {
    const res = await axios.get(`${API_BASE}/latest`);
    return res.data;
  } catch (err) {
    console.error("Error fetching latest reading:", err);
    return null;
  }
};
